DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `OP_ObtenerTotalEgresos_Fechas`(IN start_date DATE, IN end_date date)
BEGIN
	SELECT SUM(cantidad * precio_unitario) as egresos
	FROM egresos
	WHERE fecha BETWEEN start_date AND end_date;
END
;;
