DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `OP_ObtenerTotalIngresos_Fechas`(IN start_date DATE, IN end_date date)
BEGIN
	SELECT SUM(cantidad * monto) AS ingresos FROM ingresos
	INNER JOIN ingresos_detalle as idt on idt.ingresoId = ingresos.id
	WHERE fecha BETWEEN start_date AND end_date;
